import { GET_CUSTOMER } from "./types";
import axios from "axios";

export const getCustomer = () => async dispatch => {
  const res = axios.get("http://localhost:8080/api/customer");

  return {
    type: GET_CUSTOMER,
    payload: res.data
  };
};
